/*import css files*/
import "./Loginformulier.css";

/*import images */


const Loginformulier = () => {
    return (
        <div className="loginwrapper">
            <form action="">
                <div className="name">
                    <label htmlFor="" className="Name"></label>
                    <input type="text" />
                </div>
                <div className="email">
                    <label htmlFor="" className="label__emial"></label>
                </div>
            </form>
        </div>
    )
}

export default Loginformulier;
